B.Bw=new A.ey("How do subscriptions work?","Select what days and meals you want. We deliver something new every day without any further input. Payments are weekly, and you can cancel your subscription at any time.",null)
B.Bs=new A.ey("What kind of food do you deliver?","We focus on unique menu items from local restaurants. We will never deliver from chains.",null)
B.Bx=new A.ey("How much variety is there?","Our alpha tests will start with low variety but quickly add more restaurants. At about 5000 customers it will become unlikely for you to eat the same meal twice over the course of a year.",null)
B.Bt=new A.ey("Do I control what I get?","Food selection will primarily be based on a recommendation engine that learns your preferences, but you will gain more control over food selection as we sign up more customers.",null)
B.Bz=new A.ey("How can you deliver food for so cheap?","We reduce costs by placing large orders and delivering them simultaneously. Restaurants also have some flexibility in what to cook, allowing them to reduce food waste.",null)
B.Bv=new A.ey("How much do drivers make?","Drivers make $15 per hour, plus 100% of all tips. Tips are always optional.",null)
B.BA=new A.ey("What if I have food allergies or dietary restrictions?","You will be able to specify restrictions in the future. However, for alpha and beta tests the restaurant variety and order volume will not be high enough to accomodate any restrictions.",null)
B.By=new A.ey("Can I eat healthy on this subscription?","Once we have enough restaurants signed up, we will offer meal-planning options where you can set target calories and nutrition profiles.",null)
B.Bu=new A.ey("What is the end goal for Restaurant Pass?","We want to reshape the economy of food by making delivery cheaper than home cooking. This will reduce food waste and free up hundreds of hours per year for everybody.",null)
