B.HO=new A.bX("My name is Matt, and I started Restaurant Pass because I couldn't find a reasonably priced restaurant delivery service, and I didn't like the food that came in mail subscription services. In my opinion, the way we prepare and eat food hasn't really changed since medieval times. In the modern day, it makes no sense that buying your own groceries and cooking your own food is still the most cost effective way of doing things. It feels a bit like building your own furniture, or milking your own cows. I started Restaurant Pass with the goal of building the infrastructure to bring our food ecosystem into the 21st century.",null,B.aB,null,null,null,null,null)
B.HQ=new A.bX("\nHow It Works\n",null,B.b1,null,null,null,null,null)
B.HL=new A.bX("If existing restaurant delivery services are like taxis, Restaurant Pass is like public transit. We let the community order and receive food in bulk in order to drive down preparation and delivery costs. At high enough densities and order volumes, we can reduce food preparation costs to 20% less than menu price, and delivery costs to $1 per order. Our initial target is to be profitable at $12 per meal, and to further optimize from there.\n\nTo do this, we use a subscription model where our customers tell us their food preferences and let us know ahead of time what days they want delivery. Then at each mealtime, our recommendation engine collates the preferences and meal rating histories of all our customers to find a minimal number of restaurants and dishes which will satisfy everyone. These orders are then placed in batches of 30 or more with partner restaurants, and delivered en masse on optimized routes.",null,B.aB,null,null,null,null,null)
B.HN=new A.bX("\nOur Plans\n",null,B.b1,null,null,null,null,null)
B.HH=new A.bX("We've talked to several partner restaurants, and are ready to launch at an initial price of $12 a meal. As delivery volumes get high enough, we plan to allow for greater meal customization, and to offer meal planning services such as weight-loss, bulking, vegetarian and vegan, gluten free etc. Eventually when we get enough customers, we plan to open up a series of single-recipe kitchens scattered throughout the city and start offering meals at $8 and $4 price ranges.\n\nBy targeting high-density customer centers first like apartment complexes and dorms, we plan to start profitable while still ensuring a cost of less than $1 per delivery. We do not plan on maintaining menus or on advertising (other than through word of mouth), so as to keep costs minimal.",null,B.aB,null,null,null,null,null)
B.HJ=new A.bX("\nOur Impact on Society\n",null,B.b1,null,null,null,null,null)
B.HP=new A.bX("The ultimate goal of Restaurant Pass is to become cheaper than home cooking, and to make cooking entirely optional, as opposed to an economic necessity. Since over 80% of people eat at home each meal, if we can make delivery cheaper, tastier, healthier, and more convenient in comparison, we could cause a seismic shift in society.\n\nOur hope is that this change will benefit everyone, by giving restaurants access to more customers, by offering ordinary people cheap and healthy food (plus saving them hundreds of hours a year on cooking), and by saving tons of food waste.",null,B.aB,null,null,null,null,null)
B.yw=A.b(s([B.jC,B.HD,B.HO,B.HQ,B.HL,B.HN,B.HH,B.HJ,B.HP]),t.p)
